import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../images/logo.png';

function Header() {

    return (
        <nav className="navbar navbar-wrapper navbar-expand-lg bg-dark navbar-dark sticky-top ">
            <div className='collapse navbar-collapse' id='navbarSupportedContent'>
           <Link className="nav-link" to="/home"><img className="card-img-top" src={logo} style={{width:"35px",height:"35px"}} alt="Card image" /></Link>

            <ul className="navbar-nav">
                <li className="nav-item">
                    <Link className="nav-link" to="/">Dashboard</Link>
                </li>     

                <li className="nav-item">
                    <Link className="nav-link" to="/user/add">Register</Link>
                </li>
                </ul>
                <form className="form-inline my-2 my-lg-0">
                
                    <Link className="btn btn-outline-danger my-2 my-sm-0 mx-2" to="/home">Logout</Link>
                
                </form>
                
                
                
           

            </div>
        </nav>
    )
}



export default Header;
